const definiciones = $("Contenido").first().json.definiciones || [];
const formatos = $("Contenido").first().json.formatos || [];
const desarrollo = $("Contenido").first().json.desarrollo || [];
const politicas = $("Contenido").first().json.politicas || [];
const indicadores = $("Contenido").first().json.indicadores || [];

let definicionesHtml = "";
let desarrolloHtml = "";
let politicasHtml = "";
let indicadoresHtml = "";
let formatosHtml = "";

const sectionFormat = 4 // "4" de 4.x
const sectionDef = 5; // "5" de "5.x"
const sectionDes = 6; // "6" de "6.x"

// --- Definiciones ---
(definiciones || []).forEach((def, i) => {
  const num = `${sectionDef}.${i + 1}`; // 5.1, 5.2...
  const texto = (def.definicion || "").replace(/\.\s*$/, ""); // evita doble punto

  definicionesHtml += `
    <div class="definicion-item">
      <span class="definicion-titulo">${num}. <strong>${def.termino || ""}</strong>:</span>
      <span class="definicion-texto"> ${texto}.</span>
    </div>`;
});

// --- Desarrollo ---
(desarrollo || []).forEach((dev, i) => {
  const num = `${sectionDes}.${i + 1}`; // 6.1, 6.2...

  desarrolloHtml += `
    <tr>
      <td>${num}</td>
      <td>${dev.responsable || ""}</td>
      <td>${dev.actividad || ""}</td>
    </tr>`;
});

// --- Políticas ---
(politicas || []).forEach((pol) => {
  politicasHtml += `
    <ul>
      <li>${pol}</li>
    </ul>`;
});

// --- Políticas ---
(indicadores || []).forEach((ind) => {
  indicadoresHtml += `
           <tr>
                <td>${ind.nombre}</td>
                <td>${ind.meta}</td>
                <td>${ind.frecuencia}</td>
                <td>${ind.dueno_dato}</td>
            </tr>
            `;
});

// --- Formatos ---
(formatos || []).forEach((format) => {
  formatosHtml += `
           <ul>
      <li>${format.codigo} - ${format.nombre}</li>
    </ul>`;

});

// --- Return ---
return [
  {
    json: {
      ...$json,
      definicionesHtml,
      desarrolloHtml,
      politicasHtml,
      indicadoresHtml,
      formatosHtml
    },
  },
];
